import React from 'react';

function Input() {
    return (
        <div className="w-1/2 justify-center">
            <input className='border-2 border-black w-full p-1' type='text'/>
        </div>
    )
}

function Container() {
    return (
        <>
            <Input/>
        </>
    );
}

export default Container;
